export const hashPassword = async (password) => {
    try {
        const hash = await bcrypt.hash(password, saltRounds);
        return hash;
    } catch (err) {
        throw err;
    }
}

export const hashRole = async (role) => {
    try {
      const hash = await bcrypt.hash(role, saltRoundsForRole);
      return hash;
    } catch (err) {
        throw err;
    }
}

export const compareHasRole = async (plainRole, hashRole) => {
    try {
      const isMatch = await bcrypt.compare(plainRole, hashRole);
      return isMatch;
    } catch (err) {
        throw err;
    }
}

export const hashForgetKey = async (role) => {
  try {
    const hash = await bcrypt.hash(role, saltForgetPass);
    return hash;
  } catch (err) {
      throw err;
  }
}

export const compareForgetKey = async (plainRole, hashRole) => {
  try {
    const isMatch = await bcrypt.compare(plainRole, hashRole);
    return isMatch;
  } catch (err) {
      throw err;
  }
}

export const comparePasswords = async (plainPassword, hashedPassword) => {
    try {
        const isMatch = await bcrypt.compare(plainPassword, hashedPassword);
        return isMatch;
    } catch (err) {
        throw err;
    }
}

const statusCodeAndMessage = {
    201: { statusCode: 201, message: 'Data saved successfully', status: 'Success' },
    200: { statusCode: 200, message: 'Data retrieved successfully', status: 'Success' },
    "update": { statusCode: 200, message: 'Data updated successfully', status: 'Success' },
    "deleted": { statusCode: 200, message: 'Data deleted successfully', status: 'Success' }
}

export const wrappSuccessResult = (statusCode, data, overrideMessage) => {
    const meta = statusCodeAndMessage[statusCode];
    if (meta) {
        return {
            status: meta.status,
            statusCode: meta.statusCode,
            message: overrideMessage || meta.message,
            data: data
        };
    }

    // If caller passed a numeric status code (e.g., 404) that isn't in the map, handle gracefully
    const numeric = Number(statusCode);
    if (!Number.isNaN(numeric)) {
        const statusText = numeric >= 200 && numeric < 300 ? 'Success' : 'Error';
        const defaultMessage = overrideMessage || (numeric === 200 ? 'Data retrieved successfully' : (numeric === 201 ? 'Data saved successfully' : 'Operation completed'));
        return {
            status: statusText,
            statusCode: numeric,
            message: defaultMessage,
            data: data
        };
    }

    // Fallback
    return {
        status: 'Success',
        statusCode: 200,
        message: overrideMessage || 'OK',
        data: data
    };
}

export const secretKey = process.env.SECRET_KEY;//crypto.randomBytes(32).toString('hex')"";
export const refreshSecretKey = process.env.REFRESH_SECRET_KEY;

export const generateToken = (user, needVeryShortTokenLife) => {
    const payload = {
        id: user._id,
        email: user.email,
        username: user.userName,
        role: user.role,
        // Ensure plan is included in the token with proper fallback
        plan: user.plan || 'free',
        organization_id: user.organization_id,
        permission: user.permission || [],
        isLimitCompleted: user.planExpired || false,
        isPlanExpired: user.isPlanExpired || false
    }

    // NOTE: needVerifyTokenLife is used for testing purposes
    // to generate a token with a very short life
    return jwt.sign(payload, secretKey, { expiresIn: needVeryShortTokenLife ? '5h' : '5h' });
}

export const generateRefreshToken = (user) => {
  const payload = {
      id: user._id,
      email: user.email,
      role: user.role,
      // Include plan in refresh token to ensure consistent data after token refresh
      plan: user.plan || 'free',
      organization_id: user.organization_id
  }

  return jwt.sign(payload, refreshSecretKey, { expiresIn: '180d' });
}

export const generateActivationKey = (user) => {
    const payload = {
        email: user.email,
        userName: user.userName
    }

    return jwt.sign(payload, secretKey, { expiresIn: '5h' });
}

export const generateForgetPasswordToken = (email, plan) => {
  const payload = {
    email: email,
    plan: plan
    }



    return jwt.sign(payload, process.env.FORGET_PASSWORD, { expiresIn: '5h' });
}

/**
 * Normalize role for token generation and UI consumption.
 * - If role is a bcrypt hash (legacy), attempt to detect super-admin via compareHasRole.
 * - If user owns an active subscription or has a plan, prefer 'clientadmin'.
 * - Otherwise fall back to the stored short-string role or 'tenant'.
 *
 * This function is async because it may call compareHasRole.
 */
export const normalizeRoleForToken = async (user, modelsRef) => {
    try {
        // If the role already looks like a short plaintext role, keep it
        if (user.role && typeof user.role === 'string' && user.role.length < 40) {
            return user.role;
        }

        // Check super-admin hashed role
        if (user.role) {
            const isAdmin = await compareHasRole("sUp&perA#min", user.role);
            if (isAdmin) return 'admin';
        }

        // If modelsRef is provided, check for active subscription or plan
        if (modelsRef && user._id) {
            const activeSub = await modelsRef.SubscriptionsDB.findOne({ userId: user._id, isActive: true });
            if (activeSub || user.plan) return 'clientadmin';
        } else if (user.plan) {
            return 'clientadmin';
        }

        // Last-resort fallback
        return 'tenant';
    } catch (err) {
        // On error, default to 'tenant'
        return 'tenant';
    }
}

    // --- Organization helpers ---
    function fnv1aToInt(str){
        let h = 0x811c9dc5;
        for (let i = 0; i < str.length; i++) {
            h ^= str.charCodeAt(i);
            h = (h + ((h << 1) + (h << 4) + (h << 7) + (h << 8) + (h << 24))) >>> 0;
        }
        return (h % 100000000) + 1; // 1..100,000,000
    }

    export function deriveOrganizationId(basis){
        const b = String(basis || '1');
        return fnv1aToInt(b);
    }

    export function deriveOrganizationIdFromUser(user){
        if (user && (user.organization_id || user.orgId)) {
            const n = Number(user.organization_id || user.orgId);
            if (!Number.isNaN(n) && n > 0) return n;
        }
        const basis = user?.id || user?._id || user?.userId || user?.email || user?.username || user?.userName || '1';
        return deriveOrganizationId(basis);
    }

