const storage = multer.memoryStorage();

// Default upload protection: per-file size limit and simple file-type whitelist.
// Configurable via environment variables:
// - MAX_UPLOAD_BYTES (number)
// - ALLOWED_UPLOAD_MIME_TYPES (comma-separated mime types)
const DEFAULT_MAX_UPLOAD_BYTES = process.env.MAX_UPLOAD_BYTES ? Number(process.env.MAX_UPLOAD_BYTES) : 5 * 1024 * 1024; // 5 MB
const DEFAULT_ALLOWED_MIME = process.env.ALLOWED_UPLOAD_MIME_TYPES ? process.env.ALLOWED_UPLOAD_MIME_TYPES.split(',').map(s=>s.trim()) : [
    'application/pdf', 'image/png', 'image/jpeg'
];

export const uploadFile = multer({ 
    storage: storage,
    limits: { fileSize: DEFAULT_MAX_UPLOAD_BYTES },
    fileFilter: (req, file, cb) => {
        const allowed = DEFAULT_ALLOWED_MIME;
        if (!file || !file.mimetype) return cb(new Error('Invalid file'));
        if (allowed.includes(file.mimetype)) return cb(null, true);
        return cb(new Error('Unsupported file type'));
    }
});

