export const processEmailTemplate = (paramObj) => {
    // email, userName, emailType, plan
    let specificTemplate = emailTemplate.find(i => i.type == paramObj.emailType);

    const activationKey = paramObj.emailType == "forgetPassword" ? generateForgetPasswordToken(paramObj.email, paramObj.plan) : generateActivationKey(paramObj)

    const activationLink = paramObj.emailType == "forgetPassword" ? `${process.env.baseDomainEndPoint}/reset-password?processid=${activationKey}` : `${process.env.baseDomainEndPoint}/user-activate?processid=${activationKey}`;


    let readyHTML = paramObj.emailType == "forgetPassword" ? specificTemplate.htmlBody.replace("{activationKey}", activationLink) : specificTemplate.htmlBody.replace("{userName}", paramObj.userName).replace("{activationKey}", activationLink);

    return {
        subject: specificTemplate.subject,
        htmlBody: readyHTML,
        activationKey: activationKey
    };
}

