// Send a raw email via Resend (to: string[] | string, from, subject, html)
export const sendRawEmail = async ({ to, from = 'Support <support@mytenantbook.com>', subject, html }) => {
    try {
        const resend = new Resend(process.env.resendKeyReceiptGeneratoreKey);
        const toList = Array.isArray(to) ? to : [to];
        console.log('sendRawEmail toList', toList);
        console.log('sendrawEmail from', from);
        const { data, error } = await resend.emails.send({ from, to: toList, subject, html });
        if (error) {
            logger.error('Resend raw email error', { error });
            return { error };
        }
        return { data };
    } catch (err) {
        logger.error('sendRawEmail unexpected error', err);
        return { error: err };
    }
}


/**
 * Extracts and processes pagination, sorting, and filtering from query parameters
 * @param {Object} query - Express req.query object
 * @returns {Object} - Processed pagination, sorting, and filter objects
 * GET http://localhost:5000/api/tenants
 * GET http://localhost:5000/api/tenants?page=1&limit=10&sort=createdAt&order=desc&name=John
 * GET http://localhost:5000/api/tenants?sort=name&order=desc
 * GET http://localhost:5000/api/tenants?sort=insuranceStatus&order=asc
 * GET http://localhost:5000/api/tenants?leaseStatus=Active&sort=name&order=desc
 * GET http://localhost:5000/api/tenants?name=John&sort=leaseStatus&order=asc
 */
export const processPagination = (query) => {
  const { page = 1, limit = 10, sort, order = "asc", ...filters } = query;

  // Convert values
  const skip = (parseInt(page) - 1) * parseInt(limit);
  const sortOrder = order === "desc" ? -1 : 1;

  // Construct filter object dynamically
  const queryFilter = {};
  for (let key in filters) {
        const value = filters[key];
        if (value !== undefined && value !== null && value !== '') {
            // If the filter looks like a numeric id (organization_id or ends with _id) or is all digits,
            // treat it as a Number to avoid creating a RegExp against a numeric schema field which
            // causes Mongoose cast errors. Otherwise use a case-insensitive RegExp for text search.
            const isIdKey = key === 'organization_id' || key.endsWith('_id');
            const isAllDigits = /^\d+$/.test(String(value));
            if (isIdKey || isAllDigits) {
                const num = Number(value);
                // Only set numeric filter when it's a valid number; else keep original value
                queryFilter[key] = Number.isNaN(num) ? value : num;
            } else {
                queryFilter[key] = new RegExp(String(value), "i"); // Case-insensitive regex search
            }
        }
  }

  // Construct sorting object dynamically
  let sortQuery = {};
  if (sort) {
    sortQuery[sort] = sortOrder;
  }

  return { skip, limit: parseInt(limit), sortQuery, queryFilter, page };
};

